import React from 'react';
import './Login.css';

function Login() {
    return (
        <div className="login">
            <div className="login__container">
                <div className="login__content">
                    <h2>Hello!</h2>

                    <p>Name</p>
                    <input type="text" />
                    <p>Password</p>
                    <input type="password" />
                </div>
            </div>
            
        </div>
    )
}

export default Login
